import React from 'react';

const Profile = ({ user }) => {
  const { name, email, photoUrl } = user;

  const photoStyle = {
    width: '150px',
    height: '150px',
    borderRadius: '50%',
    objectFit: 'cover',
    backgroundColor: '#ccc',
  };

  return (
    <div style={{ textAlign: 'center' }}>
      <h2>Perfil de Usuario</h2>
      <div style={{ marginBottom: '20px' }}>
        <div style={{ display: 'inline-block', position: 'relative' }}>
          <img src={photoUrl} alt="User" style={photoStyle} />
          {!photoUrl && <div style={{ ...photoStyle, position: 'absolute', top: 0, left: 0, backgroundColor: '#ccc' }}></div>}
        </div>
      </div>
      <p><strong>Nombre:</strong> {name}</p>
      <p><strong>Email:</strong> {email}</p>
      {/* Otros campos de perfil como fecha de registro, direcci√≥n, etc. */}
    </div>
  );
};

export default Profile;
